    false,nt"url": null,nt"notes": "The Kidsu2019 Well-being Indicators Clearinghouse
    (KWIC) contains county-level health, education and well-being data for children
    and youth and is used as a tool to advance policy development, planning and accountability.
    KWIC users are able to create: pre-built and custom indicator and county reports;
    motion charts; custom regions with aggregated data; presentation-ready data snapshots
    (KWIC Views); MyKWIC accounts to save frequently used queries and custom regions;
    and color-shaded maps using KWIC data u2014 users have the ability to display community
    assets and district overlays on the maps as well as compare maps over time. Narratives
    and data source information are available for every indicator and all data on KWIC
    are exportable",nt"license_title": "License Not Specified",nt"extras":
